function insertGradients() {
    var svgElement = document.getElementById("mysvg");
    var defs = svgElement.querySelector('defs') || svgElement.insertBefore(document.createElementNS('http://www.w3.org/2000/svg', 'defs'), svgElement.firstChild);

    COLOR_GRADIENTS.forEach(function(gradient, index) {
        var linearGradient = document.createElementNS('http://www.w3.org/2000/svg', 'linearGradient');
        linearGradient.id = gradient.name;
        linearGradient.setAttribute("x1", "0%");
        linearGradient.setAttribute("x2", "100%");
        if (gradient.repeat) {
            var percent = 100 / gradient.repeat;
            linearGradient.setAttribute("x2", `${percent.toFixed(2)}%`)
            linearGradient.setAttribute("spreadMethod", "repeat");
        }

        gradient.colors.forEach(function(colorStop) {
            var stop = document.createElementNS('http://www.w3.org/2000/svg', 'stop');
            stop.setAttribute('stop-color', colorStop.color);
            stop.setAttribute('offset', colorStop.percent);
            linearGradient.appendChild(stop);
        });

        defs.appendChild(linearGradient);
    });
}
